--- FUNCTION SOURCE (subtract) id{10,0} ---
(A, B){

  var comp = compare_abs(A, B)
  if ( comp === 0 ) {
    return zero
  } else if ( comp < 0 ) {
    var T = A
    A = B
    B = T
  }

  var size_r = heap[adrs[A]]

  var R = alloc(size_r)
  var Rp = adrs[R]

  var Ap = adrs[A]
  var Bp = adrs[B]

  var size_a = heap[Ap]
  var size_b = heap[Bp]

  heap[Rp + 1] = 0 // type integer

  var r = 0
  var carry = 0

  for ( var i = 2; i < size_b; i ++ ) {
    r = heap[Ap + i] - heap[Bp + i] - carry
    if ( r < 0 ) {
      r += 0x4000000
      carry = 1
    } else {
      carry = 0
    }
    heap[Rp + i] = r
  }
  for ( ; i < size_a; i ++ ) {
    r = heap[Ap + i] - carry
    if ( r < 0 ) {
      heap[Rp + i] = r + 0x4000000
      carry = 1
    } else {
      heap[Rp + i] = r
      carry = 0
    }
  }
  heap[Rp + i] -= carry

  var trailing_zeroes = 0
  while ( heap[Rp + (--i)] === 0 && i > 1) {
    trailing_zeroes++
  }
  if ( trailing_zeroes ) heap[Rp] = size_r - trailing_zeroes

  return R
}

