(A, B){
  if ( A === B ) return 0
  var Ap = adrs[A]
  var Bp = adrs[B]

  var a_size = heap[Ap]
  var b_size = heap[Bp]

  if ( a_size < b_size ) {
    return -1
  } else if ( b_size < a_size ) {
    return 1
  } else {
    for ( var i = a_size - 1; i > 1; i-- ) {
      if ( heap[Ap + i] < heap[Bp + i] ) {
        return -1
      } else if ( heap[Ap + i] > heap[Bp + i] ) {
        return 1
      }
    }
    return 0
  }
}

