(str){
  str = str.trim()
  if ( ! /^[\x5c+-]?[0-9]+$/.test(str) ) throw new Error('not a valid base10')
  if ( str[0] === '+' ) {
    var s = 0
    str = str.slice(1)
  } else if ( str[0] === '-' ) {
    var s = 1
    str = str.slice(1)
  } else {
    var s = 0
  }
  
  var x = parse_base10(str)
  heap[adrs[x] + 1] = s
  return x
}

